import sys
input = sys.stdin.readline

def solve():
    parts = input().split()
    n = int(parts[0])
    ops = parts[1] if len(parts) > 1 else ""
    out = []
    # Determine the net effect of the operations
    net_rotation = 0
    reflect_x = False
    for op in ops:
        if op == 'R':
            net_rotation += 1
        elif op == 'H':
            net_rotation += 2
        elif op == 'D':
            net_rotation -= 1
        elif op == 'X':
            reflect_x = not reflect_x
    # Normalize the net rotation to be within 0-3
    net_rotation = net_rotation % 4
    for _ in range(n):
        x, y = map(int, input().split())
        # Apply the net rotation
        if net_rotation == 1:
            x, y = -y, x  # R
        elif net_rotation == 2:
            x, y = -x, -y  # H
        elif net_rotation == 3:
            x, y = y, -x  # D
        # Apply reflection if needed
        if reflect_x:
            y = -y
        out.append(f"{x} {y}")
    print('\n'.join(out))

solve()
